import React from 'react';  
// import {Component} from 'react';  
import './App.css';

const App = () => {
  return (
	<div clasName="App">	
	<header>
		<img src="https://w7.pngwing.com/pngs/635/870/png-transparent-logo-flower-flower-purple-violet-logo-thumbnail.png" />  
	</header>  	
	<nav>
		<div>
			Profile  
	    </div>  
		<div>
			Messages  
	    </div>  
	</nav>  	
		<div>
			Main content   
	    </div> 
	</div>
  );
}

export default App;
